    height: 17px;
    padding: 0;
    margin: 2px 3px;
  }
  
  #toolbar-open:before {
    content: "\e60b";  
  }
  
  #toolbar-remove:before {
    content: "\e60a";
    font-size: 16px;
  }
  
  #toolbar-start:before,
  #toolbar-start-all:before {
    content: "\e60e";
  }
  
  #toolbar-pause:before,
  #toolbar-pause-all:before {
    content: "\e60f";
  }
  
  div#toolbar > div,
  #statusbar,
  div.torrent_footer {
    background-image: none !important;
  }
  
  div.torrent_footer > * {
    width: inherit;
    height: inherit;
    padding: 2px 3px;
    float: none;
    border: none;
    -moz-user-select: none;
  }
  
  div.torrent_footer > div {
    display: table-cell;
    width: 21px;
    background-color: transparent !important;
    cursor: pointer;
    text-align: center;
  }
  
  .trans_menu div.inner {
    top: -220px !important;
  }
  
  .trans_menu ul {
    bottom: 0px;
  }
  
  div.torrent_footer > div.selected,
  div.torrent_footer #settings_menu #button.active {
    color: #3D9DEA;
  }
  
  #statusbar #filter input#torrent_search {
    border-radius:0px;
  }
  
  div.torrent_footer #settings_menu #button:before {
    content: "\e608";
  }
  
  div.torrent_footer #prefs-button:before {
    content: "\e607";
  }
  
  div.torrent_footer #turtle-button:before {
    content: "\e609";
  }
  
  div.torrent_footer #turtle-button.selected:before {
    content: "\e609";
  }
  
  div.torrent_footer #compact-button:before {
    content: "\e606";
  }
  
  div.torrent_footer #compact-button.selected:before {
    content: "\e605";
  }
  
